package org.guo.leetCode;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Anagrams {

    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> res = new ArrayList<>();
        Map<Character, Integer> pElements = resolve(p);
        for (int i = 0; i <= s.length() - p.length(); i++) {
            if (isAnagrams(resolve(s.substring(i, i + p.length())), pElements)) {
                res.add(i);
            }
        }
        return res;
    }

    private Map<Character,Integer> resolve(String p) {
        Map<Character, Integer> res = new HashMap<>();
        for (int i = 0; i < p.length(); i++) {
            if (res.containsKey(p.charAt(i))) {
                res.put(p.charAt(i), res.get(p.charAt(i)) + 1);
            } else {
                res.put(p.charAt(i), 1);
            }
        }
        return res;
    }

    public boolean isAnagrams(Map<Character, Integer> check, Map<Character, Integer> p) {
        for (Map.Entry<Character, Integer> entry : p.entrySet()) {
            if (!check.containsKey(entry.getKey()) || !check.get(entry.getKey()).equals(entry.getValue())) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        System.out.println(new Anagrams().findAnagrams("",
                ""));
    }
}
